 // Set base style of vector data
 function style(feature) {
      return {
        weight: 1,
        fillOpacity: 0.25,
        fillColor: '#FFEDA0',
        color: '#ff9900'
      };
    }

    // Set hover colors
    function highlightFeature(e) {
      var layer = e.target;
      layer.setStyle({
        weight: 5,
        opacity: 1,
        color: '#ff9900',
        dashArray: '3',
        fillOpacity: 0.5,
        fillColor: '#FEB24C'
      });
    }

    // A function to reset the colors when a neighborhood is not longer 'hovered'
    function resetHighlight(e) {
      catchmentLayer.resetStyle(e.target);
    }

    // Tell MapBox.js what functions to call when mousing over and out of a neighborhood
    function onCatchment(feature, layer) {
      layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight
      });
       if (feature.properties && feature.properties.popup) {
        layer.bindPopup(feature.properties.popup);
    }
    }

    // Add vector data to map
var catchmentLayer = L.geoJson(catchment, {
      style: style,
      onEachFeature: onCatchment
    });

